// src/components/Register.js
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';
import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL || 'http://192.168.0.180:5005/api';

const Register = () => {
  const [formData, setFormData] = useState({
    client_id: '',
    api_key: '',
    userid: '',
    password: '',
    two_fa: '',  // This will store PAN card information
    client_code: ''
  });
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });

    // If userid is changed, automatically update vendor_info to match
    if (name === 'userid') {
      setFormData(prev => ({
        ...prev,
        [name]: value,
        vendor_info: value
      }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Basic validation - now password and client_code are required
    const requiredFields = ['client_id', 'api_key', 'userid', 'password', 'two_fa', ];
    for (const field of requiredFields) {
      if (!formData[field]?.trim()) {
        toast.error(`${field.replace('_', ' ')} is required`);
        return;
      }
    }

    // PAN card validation (basic format check for Indian PAN)
    const panRegex = /^[A-Z]{5}[0-9]{4}[A-Z]{1}$/;
    if (!panRegex.test(formData.two_fa)) {
      toast.error('Please enter a valid PAN card number (e.g., ABCDE1234F)');
      return;
    }

    setLoading(true);

    try {
      // Prepare data for backend - automatically sets vendor_info equal to userid
      const registrationData = {
        ...formData,
        vendor_info: formData.userid
      };

      const response = await axios.post(
        `${API_URL}/register`, 
        registrationData
      );

      toast.success('Registration successful! You can now authenticate.');
      navigate('/login');
    } catch (error) {
      const message = error.response?.data?.message || 'Registration failed. Please try again.';
      toast.error(message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="row justify-content-center">
      <div className="col-md-8">
        <div className="card">
          <div className="card-header">
            <h4 className="text-center"> Save Your Information</h4>
          </div>
          <div className="card-body">
            <form onSubmit={handleSubmit}>
              <div className="mb-3">
                <label htmlFor="client_id" className="form-label">
                  Client ID *
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="client_id"
                  name="client_id"
                  value={formData.client_id}
                  onChange={handleChange}
                  required
                />
              </div>

              <div className="mb-3">
                <label htmlFor="api_key" className="form-label">
                  API Key *
                </label>
                <input
                  type="password"
                  className="form-control"
                  id="api_key"
                  name="api_key"
                  value={formData.api_key}
                  onChange={handleChange}
                  required
                />
              </div>

              <div className="mb-3">
                <label htmlFor="userid" className="form-label">
                  User ID *
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="userid"
                  name="userid"
                  value={formData.userid}
                  onChange={handleChange}
                  required
                />
                <small className="form-text text-muted">
                  This will also be used as your Vendor Info
                </small>
              </div>

              <div className="mb-3">
                <label htmlFor="password" className="form-label">
                  Password *
                </label>
                <input
                  type="password"
                  className="form-control"
                  id="password"
                  name="password"
                  value={formData.password}
                  onChange={handleChange}
                  required
                />
                <small className="form-text text-muted">
                Same as Moti Lal Oswal Deemat Accounts Password
                </small>
              </div>

              <div className="mb-3">
                <label htmlFor="two_fa" className="form-label">
                  PAN Card Number *
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="two_fa"
                  name="two_fa"
                  placeholder="ABCDE1234F"
                  value={formData.two_fa}
                  onChange={handleChange}
                  required
                />
                <small className="form-text text-muted">
                  This will be used for two-factor authentication
                </small>
              </div>

              {/* <div className="mb-3">
                <label htmlFor="client_code" className="form-label">
                  Client Code *
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="client_code"
                  name="client_code"
                  value={formData.client_code}
                  onChange={handleChange}
                  required
                />
              </div> */}

              <div className="d-grid gap-2">
                <button
                  type="submit"
                  className="btn btn-primary"
                  disabled={loading}
                >
                  {loading ? (
                    <span>
                      <span className="spinner-border spinner-border-sm me-2" />
                      saving...
                    </span>
                  ) : (
                    'Save Information'
                  )}
                </button>
              </div>
            </form>
            <div className="mt-3 text-center">
              <p>
                Already have your Information Saved?{' '}
                <a href="/login">Authenticate here</a>
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
